-- -- ALTER DATABASE "transport-mhpl" OWNER TO admin;
-- \connect -reuse-previous=on "dbname='transport-mhpl'"

CREATE TABLE public."Transports" (
    "Id" integer NOT NULL,
    "Type" text NOT NULL,
    "DepartureDate" date NOT NULL,
    "DepartureTime" time without time zone NOT NULL,
    "ArrivalDate" date NOT NULL,
    "ArrivalTime" time without time zone NOT NULL,
    "DestinationCity" text NOT NULL,
    "DestinationCountry" text NOT NULL,
    "OriginCity" text NOT NULL,
    "OriginCountry" text NOT NULL,
    "SeatsNumber" integer NOT NULL,
    "SeatsTaken" integer NOT NULL,
    "PricePerTicket" numeric NOT NULL
);

CREATE TABLE public."TransportsEvents" (
    "TransportId" integer NOT NULL,
    "SequenceNumber" integer NOT NULL,
    "SeatsChange" integer NOT NULL,
    "PriceChange" numeric NOT NULL
);

ALTER TABLE public."Transports" ALTER COLUMN "Id" ADD GENERATED BY DEFAULT AS IDENTITY (
    SEQUENCE NAME public."Transports_Id_seq"
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);

